// import logo from './logo.svg';
import './App.css';
import { AgregarEstudiante } from './estudiantes/AgregarEstudiante';
import { EditarEstudiante } from './estudiantes/EditarEstudiante';
import { ListaEstudiantes } from './estudiantes/ListaEstudiantes';


function App() {
  return (
    <div className="App">
      <h1>CRUD MERN stack</h1>
      <ListaEstudiantes/>
      <AgregarEstudiante/>
      <EditarEstudiante/>
    </div>
  );
}

export default App;
